import React, { useState } from "react";

const Index = () => {
  const [list, setList] = useState([]);
  const [message, setMessage] = useState({
    text: "",
    count: 0,
  });
  return (
    <>
      <form>
        <input
          type="text"
          value={message.text}
          onChange={(e) =>
            setMessage({
              ...message,
              text: e.target.value,
            })
          }
        />
        <button
          onClick={() => {
            e.preventDefault();
            setList(message);
          }}
        >
          submit
        </button>
        <h1>{list.text}</h1>
      </form>
    </>
  );
};
export default Index;
